import React from 'react';
import { Typography, Container } from '@mui/material';

const Homepage = () => {
  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Welcome to My App
      </Typography>
      <Typography variant="body1">
        This is the main landing page. Explore places and coordinate events with your friends.
      </Typography>
    </Container>
  );
};

export default Homepage;
